import React from 'react';

export default function TableDataRow({user}) {
    return (
        <tr>
            <td >{user.STT}</td>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.created}</td>
            <td>{user.updated}</td>
        </tr>
    );
}
